n links.";s:15:"gettext_context";s:0:"";}i:972;O:8:"stdClass":6:{s:2:"id";s:4:"4523";s:6:"status";N;s:3:"ctx";s:32:"7b0c60491aec7654518f94c1af7bec98";s:10:"translated";N;s:8:"original";s:14:"Post Via Email";s:15:"gettext_context";s:0:"";}i:973;O:8:"stdClass":6:{s:2:"id";s:4:"4524";s:6:"status";N;s:3:"ctx";s:32:"a791ea41b523e28ddb53d96846b2ed9b";s:10:"translated";N;s:8:"original";s:287:"Post via email settings allow you to send your WordPress install an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.";s:15:"gettext_context";s:0:"";}i:974;O:8:"stdClass":6:{s:2:"id";s:4:"4525";s:6:"status";N;s:3:"ctx";s:32:"d6de9b4db052e1e23c15c3327bb0e33d";s:10:"translated";N;s:8:"original";s:15:"Update Services";s:15:"gettext_context";s:0:"";}i:975;O:8:"stdClass":6:{s:2:"id";s:4:"4526";s:6:"status";N;s:3:"ctx";s:32:"fbbda771c29199a924ff990070d6e9ef";s:10:"translated";N;s:8:"original";s:82:"If desired, WordPress will automatically alert various services of your new posts.";s:15:"gettext_context";s:0:"";}i:976;O:8:"stdClass":6:{s:2:"id";s:4:"4527";s:6:"status";N;s:3:"ctx";s:32:"08948187d981641a518af246fecd3c60";s:10:"translated";N;s:8:"original";s:99:"<a href="https://codex.wordpress.org/Settings_Writing_Screen">Documentation on Writing Settings</a>";s:15:"gettext_context";s:0:"";}i:977;O:8:"stdClass":6:{s:2:"id";s:4:"4528";s:6:"status";N;s:3:"ctx";s:32:"8a1cd085e6c8fc735add870b66ca1e84";s:10:"translated";N;s:8:"original";s:21:"Default Post Category";s:15:"gettext_context";s:0:"";}i:978;O:8:"stdClass":6:{s:2:"id";s:4:"4529";s:6:"status";N;s:3:"ctx";s:32:"711b98faf1a3ce98ace796103910a576";s:10:"translated";N;s:8:"original";s:19:"Default Post Format";s:15:"gettext_context";s:0:"";}i:979;O:8:"stdClass":6:{s:2:"id";s:4:"4530";s:6:"status";N;s:3:"ctx";s:32:"2fbe958a0161b004d26a543a2bc87502";s:10:"translated";N;s:8:"original";s:14:"Post via email";s:15:"gettext_context";s:0:"";}i:980;O:8:"stdClass":6:{s:2:"id";s:4:"4531";s:6:"status";N;s:3:"ctx";s:32:"e5d04cec1f79288076c30771c85f5983";s:10:"translated";N;s:8:"original";s:259:"To post to WordPress by email you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: %1$s, %2$s, %3$s.";s:15:"gettext_context";s:0:"";}i:981;O:8:"stdClass":6:{s:2:"id";s:4:"4532";s:6:"status";N;s:3:"ctx";s:32:"105bad0d1854771edafd33f642ad0e6e";s:10:"translated";N;s:8:"original";s:11:"Mail Server";s:15:"gettext_context";s:0:"";}i:982;O:8:"stdClass":6:{s:2:"id";s:4:"4533";s:6:"status";N;s:3:"ctx";s:32:"1ea8ec6e6f33d9ff33bcd5c6aa247fdd";s:10:"translated";N;s:8:"original";s:4:"Port";s:15:"gettext_context";s:0:"";}i:983;O:8:"stdClass":6:{s:2:"id";s:4:"4534";s:6:"status";N;s:3:"ctx";s:32:"8020fbbbc0b819db772943bc08f54e4d";s:10:"translated";N;s:8:"original";s:10:"Login Name";s:15:"gettext_context";s:0:"";}i:984;O:8:"stdClass":6:{s:2:"id";s:4:"4535";s:6:"status";N;s:3:"ctx";s:32:"4261ce6e24392ee3baa66fdd8afb5bc8";s:10:"translated";N;s:8:"original";s:21:"Default Mail Category";s:15:"gettext_context";s:0:"";}i:985;O:8:"stdClass":6:{s:2:"id";s:4:"4536";s:6:"status";N;s:3:"ctx";s:32:"e29a9e2481240857588346ebbc9cf09d";s:10:"translated";N;s:8:"original";s:171:"WordPress is not notifying any <a href="https://codex.wordpress.org/Update_Services">Update Services</a> because of your site&#8217;s <a href="%s">visibility settings</a>.";s:15:"gettext_context";s:0:"";}i:986;O:8:"stdClass":6:{s:2:"id";s:4:"4538";s:6:"status";N;s:3:"ctx";s:32:"a133f68ecc6a9bb928b4ba4d87153d5e";s:10:"translated";N;s:8:"original";s:16:"General Settings";s:15:"gettext_context";s:0:"";}i:987;O:8:"stdClass":6:{s:2:"id";s:4:"4539";s:6:"status";N;s:3:"ctx";s:32:"d26fb5550b496dbd22188d52f7b828ab";s:10:"translated";N;s:8:"original";s:11:"Y-m-d H:i:s";s:15:"